import React from 'react';
import { Container, Typography, Box, Button, Grid, Card, CardContent, useTheme, IconButton } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ minHeight: '100vh', backgroundColor: '#0D1117', color: 'white', fontFamily: 'Poppins, sans-serif' }}>
      <Box
        sx={{
          position: 'relative',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          textAlign: 'center',
          background: 'linear-gradient(135deg, #1F2937 30%, #111827 100%)',
          overflow: 'hidden',
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2 }}>
          <Typography
            variant="h1"
            sx={{
              fontSize: { xs: '3rem', md: '4rem' },
              fontWeight: 700,
              mb: 2,
              background: 'linear-gradient(90deg, #38BDF8, #EC4899)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            Master Your Time
          </Typography>
          <Typography variant="h5" sx={{ color: '#94A3B8', mb: 4, fontWeight: 500 }}>
            AI-Powered Study Schedule Optimization
          </Typography>
          <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2 }}>
            <Button
              variant="contained"
              size="large"
              onClick={() => navigate('/register')}
              sx={{
                background: 'linear-gradient(90deg, #2563EB, #9333EA)',
                px: 4,
                py: 2,
                fontSize: '1.1rem',
                fontWeight: 600,
              }}
            >
              Get Started
            </Button>
            <Button
              variant="outlined"
              size="large"
              onClick={() => navigate('/login')}
              sx={{
                color: '#FACC15',
                borderColor: '#FACC15',
                px: 4,
                py: 2,
                fontSize: '1.1rem',
                fontWeight: 600,
              }}
            >
              Login
            </Button>
          </Box>
        </Container>
        <Box
          sx={{
            position: 'absolute',
            bottom: 30,
            left: '50%',
            transform: 'translateX(-50%)',
            textAlign: 'center',
            cursor: 'pointer',
          }}
          onClick={scrollToFeatures}
        >
          <Typography variant="body2" sx={{ color: '#94A3B8', mb: 1 }}>
            Scroll Down
          </Typography>
          <IconButton sx={{ color: '#FACC15' }}>
            <KeyboardArrowDownIcon fontSize="large" />
          </IconButton>
        </Box>
      </Box>

      {/* Features Section */}
      <Box id="features" sx={{ py: 10, background: '#111827' }}>
        <Container maxWidth="lg">
          <Typography variant="h3" align="center" sx={{ color: '#FACC15', mb: 6, fontWeight: 600 }}>
            Why Choose Tempo?
          </Typography>
          <Grid container spacing={4}>
            {[
              {
                icon: <AccessTimeIcon sx={{ fontSize: 50, color: '#38BDF8' }} />,
                title: 'Smart Scheduling',
                description: 'AI-powered scheduling that adapts to your study habits and preferences.',
              },
              {
                icon: <AutoGraphIcon sx={{ fontSize: 50, color: '#EC4899' }} />,
                title: 'Performance Analytics',
                description: 'Track your progress and optimize your study efficiency with real-time insights.',
              },
              {
                icon: <CalendarMonthIcon sx={{ fontSize: 50, color: '#FACC15' }} />,
                title: 'Seamless Planning',
                description: 'Effortlessly manage your academic schedule with our intuitive interface.',
              },
            ].map((feature, index) => (
              <Grid item xs={12} md={4} key={index}>
                <Card sx={{ background: '#1E293B', p: 4, textAlign: 'center', borderRadius: 4 }}>
                  <Box sx={{ mb: 3 }}>{feature.icon}</Box>
                  <Typography variant="h5" sx={{ color: 'white', fontWeight: 600, mb: 2 }}>
                    {feature.title}
                  </Typography>
                  <Typography variant="body1" sx={{ color: '#94A3B8' }}>
                    {feature.description}
                  </Typography>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
